import React from 'react'
import {DataGrid} from "@mui/x-data-grid"

export default function TertiaryNav(props) {
    return (
        <div className="tertnav">
            <DataGrid
  filterModel={{
    items: [{ columnField: 'commodity', operatorValue: 'contains', value: 'rice' }],
  }}
/>
        </div>
    )
}
